$(document).ready(function(){
  $('#notifications').on("click", function() {
    var read_at = Date($.now());
    var notification_ids = $('#notification').val();
    $('.badgeAlert').remove();
    $.ajax({
      type: 'GET',
      url: '/notifications',
      data:  {read_at: read_at, notification_ids: notification_ids}
    });
  })
})
